import React, { useState, use } from 'react'
import "../Home/Home.css"

const Home = () => {

    const [isOpen, setIsOpen] = useState(false);

    const handleOutsideClick = (event) => {
        if (!event.target.closest('.services')) {
            setIsOpen(false);
        }
    };

    useEffect(() => {
        if (isOpen) {
            document.body.addEventListener('click', handleOutsideClick);
        }
        return () => {
            document.body.removeEventListener('click', handleOutsideClick);
        };
    }, [isOpen]);

    return (
        <>
            <div className="home">
                <div className="upper-container">
                    <h3>Book International and Domestic Flights</h3>
                </div>
                <div className="container">
                    <div className="info">
                        up info
                    </div>
                    <div className="find-flight">
                        <div className="flight">
                            <button className='btn booking-btns' onClick={() => { setIsOpen((isOpen) => { return !isOpen }) }}>From<i class="ri-arrow-down-s-line"></i></button>
                            <h1 className='city'>Delhi</h1>
                            <span className='airport-name'>DEL, Delhi Airport India</span>
                            {isOpen === true && <div className='dropdown-airport'>
                                <ul class="">
                                    <li><a class="dropdown-item" href="#">Action</a></li>
                                    <li><a class="dropdown-item" href="#">Another action</a></li>
                                    <li><a class="dropdown-item" href="#">Something else here</a></li>
                                </ul>
                            </div>}
                        </div>
                        <div className="flight">
                            <button className='btn booking-btns'>To<i class="ri-arrow-down-s-line"></i></button>
                            <h1 className='city'>Bangaluru</h1>
                            <span className='airport-name'>BLR, Kempegawon International air...</span>
                        </div>
                        <div className="flight">
                            <button className='btn booking-btns'>Departure<i class="ri-arrow-down-s-line"></i></button>
                            <h1>3<em>Oct'23</em></h1>
                            <span className='airport-name'>Tuesday</span>
                        </div>
                        <div className="flight last-div">
                            <button className='btn booking-btns'>Traveller<i class="ri-arrow-down-s-line"></i></button>
                            <h1>1<em>Traveller</em></h1>
                            <span className='airport-name'>Economy/Premium Economy</span>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Home
